@scoder, thanks for feedback. I believe it is better to keep `print*` outside. Let me explain: `test_X` function verifies method X for consistency in between Py and Cy implementation and allows the test to verify actual result. Some results are strings, some boolean, some integers. We use `print`/`print_all` only for strings and list of strings kinds of result. We do not use print for boolean and integer results.

So for consistency I suggest to keep all `test_*` functions as close as possible to each other: retrieve py and cy values, assert that they are the same and return that result for inspection. Then in the tests themselves it will be always clear what to expect from `test_X`: it does call `unicode.X` and returns the result.

Do you think that makes sense?
